import "./App.css";
import { Navbar } from "./components/Landing/Navbar";

import { BrowserRouter as Router, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />

        <Route path="/"></Route>
        <Route path="/"></Route>
        <Route path="/"></Route>
      </Router>
    </div>
  );
}

export default App;
